#region Helper Functions
function Write-Status {
    param(
        [string]$Message,
        [ValidateSet("Info", "Success", "Warning", "Error", "Header", "Critical", "Git")]
        [string]$Type = "Info"
    )

    $colors = @{
        Info     = "Cyan"
        Success  = "Green"
        Warning  = "Yellow"
        Error    = "Red"
        Header   = "Magenta"
        Critical = "Red"
        Git      = "DarkYellow"
    }

    $prefixes = @{
        Info     = "[*]"
        Success  = "[+]"
        Warning  = "[!]"
        Error    = "[x]"
        Header   = "==="
        Critical = "[!!!]"
        Git      = "[git]"
    }

    $color = $colors[$Type]
    $prefix = $prefixes[$Type]

    if ($Type -eq "Header") {
        Write-Host ""
        Write-Host "$prefix $Message $prefix" -ForegroundColor $color
        Write-Host ("=" * ($Message.Length + 8)) -ForegroundColor $color
    } else {
        Write-Host "$prefix $Message" -ForegroundColor $color
    }
