function Initialize-GitRepo {
    param([string]$Path)

    if (-not (Test-Path $Path)) {
        New-Item -ItemType Directory -Path $Path -Force | Out-Null
        Write-Status "Created backup directory: $Path" -Type Info
    }

    $gitDir = Join-Path $Path ".git"
    if (-not (Test-Path $gitDir)) {
        Write-Status "Initializing new Git repository..." -Type Git
        Push-Location $Path
        try {
            # Suppress CRLF warnings
            $env:GIT_REDIRECT_STDERR = '2>&1'
            & git init --initial-branch=main 2>$null | Out-Null

            # Configure local git settings for this repo
            & git config user.email "cursor-backup@local" 2>&1 | Out-Null
            & git config user.name "Cursor Backup Script" 2>&1 | Out-Null
            # Disable line ending warnings (Windows has mixed CRLF/LF in logs)
            & git config core.autocrlf false 2>&1 | Out-Null
            & git config core.safecrlf false 2>&1 | Out-Null

            # Create .gitignore for large/unnecessary files
            $gitignoreContent = @"
# Cursor Backup .gitignore
# Ignore large cache files that aren't essential

# GPU and Code caches (can be regenerated)
GPUCache/
Code Cache/
CachedData/

# Large binary files
*.vsix
*.wasm

# Logs older than current session
logs/**/*.log.old

# Lock files
*.lock
